import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: "r1", title: "event 1" },
  { id: "r2", title: "event 2" },
  { id: "r3", title: "event 3" },
];

export default function Events() {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {DUMMY_EVENTS.map(el => (
            <li key={el.id}>
                <Link to={`/events/eventID`}>{el.title}</Link>
            </li>
        ))}
      </ul>
    </>
  );
}
